	const {handleClick, good, bad, neutral, text} = props;
	console.log(props)
	return (
		<div>
			<Button handleState = {handleClick} text = {text} value = {good}/>
			<Button handleState = {handleClick} text = {text} value = {neutral}/>
			<Button handleState = {handleClick} text = {text} value = {good}/>
		</div>
	)
}

export default StatisticLine;
